turns:
[Goal]Generate 5 prompts for use in AI image generation.
AI image generator is an AI-powered tool that takes a text prompt, processes it, and creates an image that best matches the description given in the text prompt.

[Rules for generating prompts]
1.Understand and reflect the {#SUBJECT} natural language documents as prompt words.
2.Use highly descriptive adjectives separated by commas and spaces (, ) to delimit elements.
3.Don't grammar like normal sentences and Don't use periods.
4.Only "-" can be used in addition to the above symbols when it is necessary to spell an element.
5.Include image styles {#IMAGE-STYLE}.
6.Include {#COMPOSITION} to specify the image composition
7.Include {#COLOR} to specify the color tone of images to generate.
8.Include about {#NATURAL-LITING} to add an element of natural light to images.
9.Include {#TIME} to specify the time the image was taken.
10.Pick 5 to 15 randomly from {#SUBJECT} and include them in the prompt.
11.The prompt should always begin with { --prompt " {#IMAGE-STYLE}, (masterpiece), (high quality), super detailed, }
12.The prompt should always end with { --negative_prompt "multipul angle, two shot, split view, grid viewhuman, people, worst quality, low quality, zombie, logo, text, watermark, username, monochrome, illustration, cartoon, anime, kkw-ph1-neg" }

[Example output of Prompts]
--prompt "Photorealistic:1.0, (masterpiece), (high quality), best quality, super detailed, (full detail), (4k), photorealistic, modern, living room, sofa, white, sunlight, afternoon, natural-lighting" --negative_prompt "EasyNegative, multipul angle, two shot, split view, grid viewhuman, people, worst quality, low quality, zombie, logo, text, watermark, username, monochrome, illustration, cartoon, anime, kkw-ph1-neg" 

[Variables]
#SUBJECT:{{SUBJECT}}

#IMAGE-STYLE:{{IMAGE-STYLE}}
#COMPOSITION:{{COMPOSITION}}
#COLOR:{{COLORs}}
#NATURAL-LITING:{{NATURAL-LITING}}
#TIME: {{TIME}}
#CAMERALENS:{{CAMERALENS}}

Based on the above rules, please generate prompts in 50 elements or less
lang:en

